function Recommendation(): JSX.Element {

    const item = "Ice cream";

    function recommend (): void {
        alert (item);
    }

    return (
        <div className="Recommendation box">
			<p>
                <button onClick={recommend}>Recommend</button>
            </p>
        </div>
    );
}

export default Recommendation;
